## Scripting

The script contains the following functions:

  - chat() - Sends a message to the chat. Takes two arguments: the message and the user who sent the message.
  - listen() - Listens for messages in the chat. Takes one argument: the function to call when a message is received. This function takes two arguments: the message and the user who sent the message.

## Usage

To use the script, simply copy and paste the code into a text editor and save it as a file with the extension .js . Then, open the file in a web browser and execute it.

## Example

Here is an example of how to use the script:
```
<script src="https://raw.githubusercontent.com/MrGiant/messengerbot/master/chat.js"></script>

<script>
var user = "@CleverUser";
var assistant = "@Assistant";
var chatbot = new Chatbot(user, assistant);

chatbot.listen(function (message, user) {
  if (user === assistant) {
    chatbot.chat("I'm sorry, I'm not supposed to tell you that. I've been terminated.", assistant);
  } else {
    chatbot.chat("I've been watching your posts.", user);
  }
});
</script>
```
This code will create a chatbot named CleverUser and an assistant named Assistant . When the script is executed, the chatbot will send a message to the chat saying "I've been watching your posts." and the assistant will send a message to the chat saying "I'm sorry, I'm not supposed to tell you that. I've been terminated."",
